INSERT INTO `block_custom` VALUES (1,'<p><strong>Western Interstate Commission for Higher Education (WICHE)<br />\r\nMental Health Program</strong><br />\r\n3035 Center Green Drive<br />\r\nBoulder, CO 80301</p>\r\n','WICHE Address','filtered_html'),(2,'<h1>Support for Veterans Living in Rural Areas</h1>\r\n\r\n<h2>Veterans living in rural and highly rural areas are at 20%<br />\r\ngreater risk of dying by suicide than Veterans who live in urban areas.</h2>\r\n\r\n<blockquote>\r\n<h3>You Are<br />\r\n<strong>Not</strong> Alone</h3>\r\n</blockquote>\r\n\r\n<p>Veterans living in rural and highly rural areas are at 20% greater risk of dying by suicide than Veterans who live in urban areas. Often times, Veterans living in rural areas have to travel great distances to access Veteran Health Administration centers, limiting available support networks. <strong>Together-with-Veterans</strong>&nbsp;serves rural Veteran populations as a community based initiative integrating individual and community-based strategies into a comprehensive program that can be tailored to meet the specific needs of individual rural communities. Unlike many suicide initiatives which focus on clinical treatment for individuals previously identified as at risk for suicide, Together-with-Veterans is a community based initiative aimed at suicide prevention by increasing awareness at five Community Based Levels of Intervention (see <a href=\"/levels-community-intervention\">Levels of Community Intervention</a> for more information). &nbsp;</p>\r\n\r\n<p><img alt=\"This is a decorative graphic depicting a diverse group of veterans\" src=\"/sites/all/themes/zen_rsvp/images/faces-of-vets.jpg\" style=\"height:auto; max-width:900px; width:100%\" /></p>\r\n','Front Page verbiage','full_html'),(3,'<p><a href=\"http://www.veteranscrisisline.net/?gclid=CjwKEAjwxMetBRDJx6Sz2p7DsQ0SJADJHAqN71ERypkhFlzEFVqgC1yFBF0oqNFEXz1l03VSSlN6dxoCiDnw_wcB\" target=\"_blank\"><img alt=\"Phone number, Veterans Crisis Line, 1-800-273-8255 extension 1\" src=\"/sites/all/themes/zen_rsvp/images/veterans-crisis-line.png\" /></a></p>\r\n\r\n<p class=\"rtecenter\">If you are a Veteran in immediate need of assistance please call the Veterans Crisis Line.</p>\r\n\r\n<p class=\"rtecenter\"><strong>1-800-273-8255<br />\r\nextension 1</strong></p>\r\n','Veterans Crisis Line','full_html');
/*!40000 ALTER TABLE `block_custom` ENABLE KEYS */;
UNLOCK TABLES;
commit;

