INSERT INTO `field_data_body` VALUES ('node','page',0,57,57,'und',0,'<p><strong>Together-with-Veterans</strong>&nbsp;employs interventions at five levels. The five intervention levels work together to simultaneously address both individual-level risk factors (e.g., help-seeking behavior, identification and management of mental illness) and community-level barriers (e.g., outreach to Veterans in need of support, availability of services and resources, and public awareness of Veteran suicide risk) that may increase risk for suicide among Veterans living in rural areas. Because community participation and ownership is integral to ensuring that these interventions are both successfully implemented and sustained, Together-with-Veterans&nbsp;emphasizes shared decision-making and community buy-in at all stages to determine what will work best in individual rural communities. Please use the below links to view descriptions and resources for each of the five intervention levels.</p>\r\n','','filtered_html'),('node','page',0,58,58,'und',0,'<p>The goal of Together with Veterans is to build and sustain local capacity to implement multiple coordinated suicide prevention strategies. Together with Veterans is a community-engaged process for identifying, selecting, and implementing a variety of evidence based and promising practices for the reduction of suicide and promotion of wellness among Veterans living in rural communities. Every community is different. Rather than a one-size-fits all approach, Together with Veterans provides a process that embraces the differences as opportunities to maximize the impact of suicide prevention efforts. By identifying local needs and contexts, suicide prevention strategies are tailored to individual communities. Together with Veterans is a partnership between local community members, Veterans Health Administration, and suicide prevention experts. The partnership brings together local knowledge and expertise with the resources, training, and technical assistance needed to enhance local capacity.</p>\r\n','','full_html'),('node','page',0,59,59,'und',0,'<p>The Together with Veterans implementation strategy is modeled after best practices in Community Based Participatory Research (CBPR).<sup><a href=\"#footnote-1\">[1]</a></sup> CBPR is a grassroots research and action framework emphasizing shared decision-making and buy-in at all stages of engagement, implementation, and evaluation. CBPR is widely recognized as an effective approach to reducing health disparities.<a href=\"#footnote-2\"><sup>[2]</sup></a> Participatory approaches to community health intervention maximize the effective implementation of evidence based practices by ensuring that the work is fully grounded in the local community’s knowledge and needs. No one knows their community better than themselves. Perhaps most important, participation means humility, listening, and learning to respect all participants as providing knowledge to improve and enhance action.</p>\r\n\r\n<h2>Together with Veterans Steps Overview</h2>\r\n\r\n<ol style=\"list-style-type:upper-roman\">\r\n	<li><strong>Build Partnerships Involving Traditional and Non-traditional Partners: </strong>Develop partnerships and identify a coalition or advisory board to oversee planning, implementation, and evaluation. In developing the coalition it is important to find champions from within the community to not only help lead the process, but also help identify the right stakeholders for the Coalition. Traditional partners may include community leadership, healthcare, social services, first responders, and external experts. Non-traditional partners are equally important and may include natural leaders and champions of Veterans’ issues, Veterans and their family members, social clubs, businesses, and other veteran organizations.</li>\r\n	<li><strong>Conduct a Community Needs and Readiness Assessment: </strong>There are numerous tools for conducting needs and readiness assessments. The assessments will be critical to guide community team members in the process of creating sustainable, community-based changes that address a variety of suicide-related risk factors. Assessments will cover characterizing the need, understanding the veteran population and community, inventorying current community resources and past efforts in suicide prevention and health promotion, understanding the history of veteran relations and health services, conducting SWOT and Readiness assessments, and identifying critical partners beyond the coalition.</li>\r\n	<li><strong>Identify Intervention and Practices to Implement: </strong>Select evidence based and promising interventions and strategies from the <a href=\"/levels-community-intervention\">Levels of Community Intervention</a> or other activities not listed that are consistent with the community’s needs and opportunities. Decisions should be based on needs, priorities, and readiness of the community to carry out interventions.</li>\r\n	<li><strong>Develop an Action and Evaluation Plan: </strong>Develop a plan for implementing the strategies. The proposed action plan will also be accompanied by a plan for conducting the necessary data collection for a thorough and valid evaluation. Evaluation not only serves to identify the impacts of the program, but also is important to implementing a continuous quality improvement strategy whereby ongoing evaluation findings can lead to program improvements to maximize outcomes.</li>\r\n	<li><strong>Implement and Evaluate: </strong>Carry out the action and evaluation plan, employing iterative feedback loops to facilitate process improvement throughout implementation and evaluation. Use the information and experience from implementation and evaluation to develop a sustainability plan.</li>\r\n</ol>\r\n\r\n<hr />\r\n<div style=\"font-size:.8em;\">\r\n<p><a name=\"footnote-1\"></a>[1] Numerous publications and books detail the methods, advantages, and challenges of CBPR, including: Faridi Z, Grunbaum JA, Gray BS, Franks A, Simoes E. Community-based participatory research: necessary next steps. <a href=\"http://www.cdc.gov/pcd/issues/2007/jul/06_0182.htm\" target=\"_blank\"> Prev Chronic Dis [serial online] 2007 Jul, Wallerstein, N., &amp; Duran, B. (2010)</a>. Community-based participatory research contributions to intervention research: the intersection of science and practice to improve health equity.&nbsp;<em>American Journal of Public Health</em>,&nbsp;<em>100</em>; and Newman, S. D., Andrews, J. O., Magwood, G. S., Jenkins, C., Cox, M. J., &amp; Williamson, D. C. (2011). Peer Reviewed: Community Advisory Boards in Community-Based Participatory Research: A Synthesis of Best Processes.<em>Preventing chronic disease</em>,&nbsp;<em>8</em>(3).</p>\r\n\r\n<p><a name=\"footnote-2\"></a>[2] Wallerstein, N. B., &amp; Duran, B. (2006). Using community-based participatory research to address health disparities. <em>Health Promotion Practice, 7</em>(3), 312-323 and <a name=\"_ENREF_1\">Trickett, E. J., Beehler, S., Deutsch, C., Green, L. W., Hawe, P., McLeroy, K., . . . Schulz, A. J. (2011). Advancing the science of community-level interventions. <em>American Journal of Public Health, 101</em>(8), 1410. </a></p>\r\n</div>\r\n\r\n<hr />','','full_html'),('node','article',0,160,160,'und',0,'<p class=\"rtecenter\">If you are a Veteran in immediate need of assistance please call the Veterans Crisis Line.</p>\r\n\r\n<p class=\"rtecenter\"><strong>1-800-273-8255<br />\r\nextension 1</strong></p>\r\n','','filtered_html');
