INSERT INTO `field_data_field_services_offerred_` VALUES ('node','resources',0,60,60,'und',0,'<p>Ask &amp; Prevent Suicide is a free smartphone app providing crisis intervention resources and information regarding suicide prevention. Used in over 80 countries, this app is based on the ASK best practices suicide prevention training program.</p>\r\n','filtered_html'),('node','resources',0,61,61,'und',0,'<p>The Crisis Text Line provides free, 24/7 emotional support for those in crisis designed for adolescent and young adult populations.</p>\r\n','filtered_html'),('node','resources',0,62,62,'und',0,'<p>The DoD: Help for Psychological Health and Traumatic Brain Injury provides 24/7 phone, live chat, and email for service members, family, friends, and clinicians for crisis services and information regarding traumatic brain injury. DCoE Outreach Center Professional Health Consultants have expertise in psychological health and traumtic brain injury in the context on military culture.</p>\r\n','filtered_html'),('node','resources',0,63,63,'und',0,'<p>Dstress Line, provided by United States Marine Corps program, provides 24/7 peer support and connections resources providing including a crisis line and live chat.</p>\r\n','filtered_html'),('node','resources',0,64,64,'und',0,'<p>The Friendship Line is a nationally accredited 24/7 crisis line, offering a human connection for people 60 years of age and older, younger disabled, and caregivers of any age. Trained staff and volunteers make and receive calls to and from individuals who are either in crisis or just in need of a friend. For many individuals, the voice at the other end of the Friendship Line is the connection they never expected to have, at a time when they need it most.</p>\r\n','filtered_html'),('node','resources',0,65,65,'und',0,'<p>IMAlive is a virtual crisis center with 100% of volunteers trained in crisis intervention. In the first year since the launch IMAlive has helped thousands of people in crisis.</p>\r\n','filtered_html'),('node','resources',0,66,66,'und',0,'<p>My3 is a free smartphone app assisting individuals experiencing suicidal thoughts to be prepared to help themselves and reach out to others when having thoughts of suicide.</p>\r\n','filtered_html'),('node','resources',0,67,67,'und',0,'<p>The National Suicide Prevention Lifeline is a 24/7 free and confidential emotional support to people in suicidal crisis or emotional distress. Since its inception, the Lifeline has engaged in a variety of initiatives to improve crisis services and advance suicide prevention.</p>\r\n','filtered_html'),('node','resources',0,68,68,'und',0,'<p>Operation Reach Out is a free a smartphone app aimed at preventing suicide among military personnel and veterans.</p>\r\n','filtered_html'),('node','resources',0,69,69,'und',0,'<p>The Suicide Lifeguard Mobile App intended for anyone concerned that someone they know may be thinking of suicide. It provides information on how to recognize warning signs of suicide; How to ask about suicidal thoughts and/or intentions; How to respond; and<br />\r\nWhere to refer someone</p>\r\n','filtered_html'),('node','resources',0,70,70,'und',0,'<p>The VA Crisis Resource Locator is a website which allows Veterans and their support networks to search for all VA and community-based services near their location including: Suicide Prevention Coordinators, Crisis Centers, VA Medical Centers, Outpatient Clincs, Veterans Benefits Administration Offices, and Vet Centers. The website also includes links to the Veteran\'s Crisis Line, Crisis Text Line, and Live Online Chat.</p>\r\n','filtered_html'),('node','resources',0,71,71,'und',0,'<p>Hopeline is a 24/7crisis support line that connects callers to certified crisis center nearest to their calling location.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,72,72,'und',0,'<p>The VA/DoD: VA - Overcoming Suicidal Thoughts and Feelings is a brief 2-page brochure that outlines coping strategies to overcome suicidal thoughts and feelings.</p>\r\n','filtered_html'),('node','resources',0,73,73,'und',0,'<p>Vet2Vet is a 24/7 crisis line which connects veterans in crisis to trained peer counselors. Peer counselors provide hope, crisis support, and assist veterans navigate the VA system to access appropriate mental health resources.</p>\r\n','filtered_html'),('node','resources',0,74,74,'und',0,'<p>The Veterans Crisis Line is a 24/7 crisis line that connects Veterans in crisis and their families and friends with qualified, caring Department of Veterans Affairs responders through a confidential toll-free hotline, online chat, or text.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,75,75,'und',0,'<p>Vets4Warriors provides 24/7 peer support for Veterans regarding legal issues, housing, medical, psychological and other need. The website also provides a list of resources to promote psychological health.</p>\r\n','filtered_html'),('node','resources',0,76,76,'und',0,'<p>Colorado Crisis Services provides 24/7 crisis support for any mental health, substance use, or emotional crisis. &nbsp;</p>\r\n','filtered_html'),('node','resources',0,77,77,'und',0,'<p>Southeast Health Group (SHG) is a private nonprofit corporation providing mental health, substance use disorder, primary care and wellness services to six rural and frontier Colorado counties – Baca, Bent, Crowley, Kiowa, Otero and Prowers including a 24/7 crisis intervention (including a mobile crisis team), and assessment services. A discounted/sliding fee schedule is available and no one is refused service due to the inability to pay. &nbsp;</p>\r\n','filtered_html'),('node','resources',0,78,78,'und',0,'<p>The Pueblo VA Suicide Prevention Coordinator is responsble for promoting suicide prevention in the Pueblo and surrounding area.</p>\r\n','filtered_html'),('node','resources',0,79,79,'und',0,'<p>Crossroads Turning Points provides comprehensive family services to fifteen counties in the Southern Colorado Region. The Alamosa location provides outpatient services substance abuse services and detox.</p>\r\n','filtered_html'),('node','resources',0,80,80,'und',0,'<p>The San Luis Behavioral Health Group (SLVBHG) is a comumunity behavioral health agency providing a comprehensive array of services including prevention, crisis intervention, outpatient mental health services, addiction treatment services, and judicial and offender services.</p>\r\n','filtered_html'),('node','resources',0,81,81,'und',0,'<p>The Is Your Patient Suicidal? ED Poster provides emergency department practitioners with information on recognizing and responding to acude suicidal risk. The poster is available as a free downloadable .pdf for $10 for printed posters</p>\r\n','filtered_html'),('node','resources',0,82,82,'und',0,'<p>The Guide for Medical Providers in the Emergency Department Taking Care of Suicide Attempt Survivors is a 14‐page brochure from U.S. Substance Abuse and Mental Health Services Administration provides information regarding Emergency Department care of suicide attempters. It is intended to increase awareness among medical professionals for serving patients who have had a suicide attempt.</p>\r\n','filtered_html'),('node','resources',0,83,83,'und',0,'<p>Counseling on Access to Legthan Means (CALM) is a free online training for mental health and medical providers. CALM teaches practical skills on when and how to ask suicidal clients about their access to lethal means and how to work with them and their families to reduce their access.</p>\r\n','filtered_html'),('node','resources',0,84,84,'und',0,'<p>The Canadian Coalition for Seniors’ Mental Health is an educational program developed for use by frontline providers, medical and mental health care clinicians, and health care trainees focusing on how to identify suicide warning signs, establish rapport and assess suicide risk and resiliency factors, and&nbsp;manage immediate and ongoing risk for suicide among older adults.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,85,85,'und',0,'<p>Citizen Soldier Support includes a number of free training modules to prepare civilian providers to address post deployment issues facing veterans and their families. Continuing education credits are available for onsite instruction.</p>\r\n','filtered_html'),('node','resources',0,86,86,'und',0,'<p>Connect Train the Trainer Suicide Prevention Training is a a National Best Practice program that incorporates key aspects of the National Suicide Prevention Strategy in a comprehensive training model which promotes an integrated community response to suicide prevention. Trainings can focus on specific service providers such as emergency departments, emergency medical services, and primary care providers. A full day trainings cost approximately $6000 for up to 30 participants and a 3 day train-the-trainer costs approximate $18,000 (for training up to 16 trainers).</p>\r\n','filtered_html'),('node','resources',0,87,87,'und',0,'<p>The MacArthur Depression Toolkit helps primary care clinicians recognize and manage depression and includes user-friendly instruments to assist with recognizing, diagnosing, treating, and monitoring depression.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,88,88,'und',0,'<p>The Prevention of Suicide in Primary Care Elderly Collaborative Trial (PROSPECT) aims to prevent suicide among older primary care patients by helping primary care providers and health specialists recognize and manage depression with the application of a treatment algorithm designed for geriatric depression.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,89,89,'und',0,'<p>The Recognizing and Responding to Suicide Risk: Essential Skills in Primary Care (RRSR-PC) is a one-hour training program that provides Physicians, Nurses/Nurse Practitioners, and Physician Assistants with the knowledge they need in order to integrate suicide risk assessments into routine office visits, to formulate relative risk, and to work collaboratively with patients to create treatment plans. In-person or webinar formats are available for $3500 for up to 200 participants.</p>\r\n','filtered_html'),('node','resources',0,90,90,'und',0,'<p>At-Risk in the ED is an online training simulation designed to prepare emergency department personnel to screen patients for mental health disorders, suicidal ideation, and substance use, collaboratively discuss treatment plans using motivational interviewing techniques, and refer patients to treatment when needed. Kognito simulations are available on a subscription basis to communities, schools, hospitals and institutions of higher education. Costs range from $5 per user to $100 per user, with an average cost of approximately $25 per user or starting at $2,500 per institution. Communities should contact Kognito for a price quote to meet their specific need: info@kognito.com or 212-675-9234.</p>\r\n','filtered_html'),('node','resources',0,91,91,'und',0,'<p>At-Risk in Primary Care is a digital learning experience designed to prepare care providers to screen patients for substance use and for mental health conditions, conduct brief interventions using motivational interviewing, and refer patients to treatment when needed. Kognito simulations are available on a subscription basis to communities, schools, hospitals and institutions of higher education. Costs range from $5 per user to $100 per user, with an average cost of approximately $25 per user or starting at $2,500 per institution. Communities should contact Kognito for a price quote to meet their specific need: info@kognito.com or 212-675-9234.</p>\r\n','filtered_html'),('node','resources',0,92,92,'und',0,'<p>The Suicide Assessment Five‐Step Evaluation and Triage (SAFE‐T) is a pocket card provides protocols for conducting a comprehensive suicide assessment, estimating suicide risk, identifying protective factors,<br />\r\nand developing treatment plans and interventions responsive to the risk level of patients. The pocket card includes triage and documentation guidelines.</p>\r\n','filtered_html'),('node','resources',0,93,93,'und',0,'<p>The Suicide Prevention Toolkit for Rural Primary Care Practices Toolkit contains tools, information, and resources to implement state-of-the art suicide prevention practices and overcome barriers to treating suicidal patients in the primary care setting including assessment guidelines, safety plans, billing tips, and sample protocols.</p>\r\n','filtered_html'),('node','resources',0,94,94,'und',0,'<p>Suicide Safe is a prevention app for mobile devices and tablets that helps providers integrate suicide prevention strategies into their practice and address suicide risk among their patients.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,95,95,'und',0,'<p>AMSR is a dynamic one-day workshop that equips new and experienced clinicians with positive and strengths-based skills to address clinical dilemmas while assisting individuals as risk for suicide on their path to recovery. This training is the most widely disseminated workshop for practicing clinicians and meets objectives included in the U.S. Surgeon General’s National Strategy for Suicide Prevention. Cost estimates: Participant fee $115; Trainer fee is approximately $1500; + travel and indirect costs.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,96,96,'und',0,'<p>Counseling on Access to Lethal&nbsp;Means (CALM) is a free online training for mental health and medical providers. CALM teaches practical skills on when and how to ask suicidal clients about their access to lethal means and how to work with them and their families to reduce their access.</p>\r\n','filtered_html'),('node','resources',0,97,97,'und',0,'<p>Veterans on Campus for Faculty &amp; Staff is an online, interactive training program that helps faculty and staff learn about the needs and experiences of student veterans. Kognito simulations are available on a subscription basis to communities, schools, hospitals and institutions of higher education. Costs range from $5 per user to $100 per user, with an average cost of approximately $25 per user or starting at $2,500 per institution.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,98,98,'und',0,'<p>ASSIST Workshops are developed for caregivers who want to feel more comfortable, confident and competent in helping to prevent the immediate risk of suicide. Materials are $38.10 plus S&amp;H + trainer fee (rates vary based on location, travel, etc). &nbsp;</p>\r\n','filtered_html'),('node','resources',0,100,100,'und',0,'<p>SafeTALK is a half-day alertness workshop that prepares anyone over the age of 15, regardless of prior experience or training, to become a suicide-alert helper. SafeTALK is $670 for 100 training kits plus S&amp;H + trainer travel costs</p>\r\n','filtered_html'),('node','resources',0,101,101,'und',0,'<p>Mental Health First Aid is an 8-hour course that teaches individuals how to help someone who is developing a mental health problem or experiencing a mental health crisis helping individuals identify, understand, and respond to signs of mental illnesses and substance use disorders. The adapted military version provides an overview of military culture and common mental health risk factors in Veteran populations</p>\r\n','filtered_html'),('node','resources',0,102,102,'und',0,'<p>The Police/Emergency Responder Suicide Prevention Tool Kit is a pocket-sized reference guide on suicide crisis intervention for police officers, EMTs, and others who may encounter potentially suicidal persons in the line of duty.</p>\r\n','filtered_html'),('node','resources',0,103,103,'und',0,'<p>The QPR Gatekeeper Training for Suicide Prevention is a brief educational program designed to teach gatekeepers to recognize and refer someone at risk of suicide. 1- to 2-hour training is delivered by certified instructors inonline for $30 for the online version with military discounts available. (In-person trainings are also available)</p>\r\n','filtered_html'),('node','resources',0,104,104,'und',0,'<p>QPR for Law Enforcement is a brief educational program designed to teach Officers to recognize and refer someone at risk of suicide. 1- to 2-hour training is delivered by certified instructors inonline for $30 for the online version (In-person trainings are also available)</p>\r\n','filtered_html'),('node','resources',0,105,105,'und',0,'<p>The QPR for Vets Gatekeeper Training for Suicide Prevention is an expanded version of the QPR program for Veteran populations. Online gatekeeper training is $79, with a 40% discount for individuals working directly with Veterans.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,106,106,'und',0,'<p>The Role of Senior Living Community Professionals in Preventing Suicide pamphlet provides basic information to help professionals working in senior living communities recognize and respond to people who may be suicidal or at high risk.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,107,107,'und',0,'<p>The Save: Suicide prevention Card for Police Officers includes information on identifying the warning signs of suicide, what to do if an officer or deputy is suicidal, and resources for more information. The card is intended for departmental use as well as for individual advocates of law enforcement suicide prevention</p>\r\n','filtered_html'),('node','resources',0,108,108,'und',0,'<p>The Connect Program offers a number of National Best Practice community based trainings that incorporate key aspects of the National Suicide Prevention Strategy in a comprehensive training model which promotes an integrated community response to suicide prevention for community gatekeepers. A full day trainings cost approximately $6000 for up to 30 participants and a 3 day train-the-trainer costs approximate $18,000 (for training up to 16 trainers).</p>\r\n','filtered_html'),('node','resources',0,109,109,'und',0,'<p>The Connect Program offers a number of National Best Practice community based trainings that incorporate key aspects of the National Suicide Prevention Strategy in a comprehensive training model which promotes an integrated community response to suicide prevention for community gatekeepers. A full day trainings cost approximately $6000 for up to 30 participants and a 3 day train-the-trainer costs approximate $18,000 (for training up to 16 trainers).</p>\r\n','filtered_html'),('node','resources',0,110,110,'und',0,'<p>The Connect Program offers a number of National Best Practice community based trainings that incorporate key aspects of the National Suicide Prevention Strategy in a comprehensive training model which promotes an integrated community response to suicide prevention for community gatekeepers. A full day trainings cost approximately $6000 for up to 30 participants and a 3 day train-the-trainer costs approximate $18,000 (for training up to 16 trainers).</p>\r\n','filtered_html'),('node','resources',0,111,111,'und',0,'<p>The Yellow Ribbon’s Be A Link!® Community Gatekeeper Training is a community friendly, peer-based, non-clinical training. &nbsp;It teaches simple, effective tools of help between those in need and support resources geared towards younger populations.</p>\r\n','filtered_html'),('node','resources',0,112,112,'und',0,'<p>The Guide to Using Facebook to Promote Suicide Prevention and Mental Illness Stigma Reduction is a 61-page guide as part of the \"It\'s Up to Us\" Mental Health Campaign to promote the use of social media in mental health awareness and suicide prevention</p>\r\n','filtered_html'),('node','resources',0,113,113,'und',0,'<p>The Action Alliance for Suicide Prevention: Workplace Task Force delivers a compelling business case that offers solutions, provides support for employers, and motivates them from inaction to the implementation of a comprehensive, public health approach to suicide prevention, intervention, and postvention in the workplace and includes a Comprehensive Blueprint for Workplace Suicide Prevention.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,114,114,'und',0,'<p>The American Foundation for Suicide Prevention (AFSP) is the leading national not-for-profit organization exclusively dedicated to understanding and preventing suicide through research, education, and advocacy. &nbsp;The Chapter Locator allows users to locate their local chapter.</p>\r\n','filtered_html'),('node','resources',0,115,115,'und',0,'<p>EsuicideTALK is a virtual classroom environment where individuals explore questions around suicide, its causes, and how it can be prevented through open and honest discussion. &nbsp;EsuicideTALK is ideal for businesses and large organizations aiming to raise awareness about suicide among their employees or members. Participants log in via a voucher system and complete the course at their own pace, typically in one to two hours. EsuicideTalk is $20 per license with group rates available.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,116,116,'und',0,'<p>The Helping Service Members, Veterans, and Their Families Through Stress and Crisis Pocket sized pamphlet provdes information regarding stress, suicial behavior, mental illness, suicide resources and how to \"Ask - Care - Escourt\" for an individual in distress.</p>\r\n','filtered_html'),('node','resources',0,117,117,'und',0,'<p>NAMI In Our Own Voice Presentations change attitudes, assumptions, and stereotypes by describing the reality of living with mental illness. People with mental health conditions share their powerful personal stories in this free, 90-minute presentation. &nbsp;</p>\r\n','filtered_html'),('node','resources',0,118,118,'und',0,'<p>Man Therapy is a resource to help men with any problem that life sends their way, something to set them straight on the realities of suicide and mental health, and a tool to help put a stop to the suicide deaths of so many of our men. Individuals in crisis can click on the \"red phone\" on the Man Therapy homepage to be provided crisis line information.</p>\r\n','filtered_html'),('node','resources',0,119,119,'und',0,'<p>The Means Matter Campaign aims to increase the proportion of suicide prevention groups who promote activities that reduce a suicidal person’s access to lethal means of suicide (including firearms and less thought of means such as high bridges). The Means Matter website provides facts and resources to raise awareness including suicide rates by geographical region and information regarding the who, when, where, how, and why\'s of suicide.</p>\r\n','filtered_html'),('node','resources',0,120,120,'und',0,'<p>SAVE: Public Awareness Campaigns is a leader in producing safe, targeted and effective suicide prevention awareness campaigns that can be incorporated into the suicide prevention programs in communities. Packages may include the following materials: Brochures, Posters, Billboard Graphics, &nbsp;and Print Ad Graphics..</p>\r\n','filtered_html'),('node','resources',0,121,121,'und',0,'<p>Save: Suicide Prevention Posters includes five different suicide posters (and wallet cards) targeting teens, adult men, adult women, American Indians and seniors.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,122,122,'und',0,'<p>Screening for Mental Health provides annual screening events as well as educational screening programs targeted toward various demographics including teenagers, college students, the general adult population, and &nbsp;Veteran Populations. Screening for Mental Health includes community based, workplace screenings/education programs, and service members, veterans, and families.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,123,123,'und',0,'<p>NAMI StigmaBusters is a network of dedicated advocates across the country and around the world who seek to fight inaccurate and hurtful representations of mental illness. The website also includes a number of resources and fliers to reduce the stigma of mental health.</p>\r\n','filtered_html'),('node','resources',0,124,124,'und',0,'<p>Suicide Prevention for Consumers and Family Members is a 26-page brochure that provides Information regarding appropriate language, risk and protective factors, mental health/co-occurring disorders, and suicide, affects of suicide, recovery, peer support, trauma, crisis intervention, hospitalization, &amp; postvention interventions.</p>\r\n','filtered_html'),('node','resources',0,125,125,'und',0,'<p>The Suicide Prevention Resource Center: Safe and Effective Messaging for Suicide Prevention &nbsp;is a brief 2-page brochure that provides an overview for the reporting of suicide in the media</p>\r\n','filtered_html'),('node','resources',0,126,126,'und',0,'<p>The Supporting Survivors of Suicide Loss: A Guide for Funeral Directors is a 16-page brochure that &nbsp;provides funeral directors with a greater understanding of the issue of suicide as it relates to their profession.</p>\r\n','filtered_html'),('node','resources',0,127,127,'und',0,'<p>The World Suicide Prevention Day (WSPD) has taken place on 10th September each year since 2003. WSPD serves as a call to action for individuals and organizations to prevent suicide through a wide array of initiatives.</p>\r\n','filtered_html'),('node','resources',0,128,128,'und',0,'<p>This Working Minds: Suicide Prevention in the Workplace Toolkit includes a facilitator’s guide and 30‐minute training DVD designed to help workplace administrators and employees better understand and prevent suicide. The program provides three options depending on resources and training needs: a 1‐hour “lunchtime” presentation, a 1.5‐hour in‐service workshop, and a 1.5‐hour in‐service workshop, and a 3.5‐hour intensive training. The toolkit with DVD is available for $99. Full‐day training for trainers is available for $1,000 ($500 for non profits).</p>\r\n','filtered_html'),('node','resources',0,129,129,'und',0,'<p>The Suicide Prevention Commission serves as the interface between the public and private sectors in establishing statewide suicide prevention priorities that are data-driven and evidence-based.</p>\r\n','filtered_html'),('node','resources',0,130,130,'und',0,'<p>This Finding the Light Within: Mural Arts Program engaged a large and diverse audience and built a new community around suicide prevention through participatory public art, including community design and production of a large public mural about suicide, storytelling and art workshops, and a storytelling website. This project is a model for how arts participation can address suicide on multiple fronts—from raising awareness and reducing stigma, to promoting community recovery, to providing healing for people and communities in need.</p>\r\n','filtered_html'),('node','resources',0,131,131,'und',0,'<p>Straight Scoop for Vets raises public awareness to the high veteran suicide rate. &nbsp;In partnership with the Rocky Mountain MIRECC, the focus of Straight Scoop for Vets is the underserved rural areas of eastern New Mexico.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,132,132,'und',0,'<p>AfterDeployment is an online resources for military and veteran populations that includes resources regarding health and wellness, mental health, anxiety, stress depression, and substtance abuse - among a number of other topics. AfterDeployment includes links to a number of resources, trainings, and online assessments to support military and veteran populations cope following deployment.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,133,133,'und',0,'<p>The American Legion’s Suicide Prevention Web Center is a resource for veterans to provide personal testimonials, data, statistics, risk factors, research, and resources to help veterans, families, and communities connect with VA’s programs in their time of transition and need. &nbsp;</p>\r\n','filtered_html'),('node','resources',0,134,134,'und',0,'<p>Chaplan Care for Veterans offers spiritual-related information, resources, and professional chaplaincy services in hospitals, other health care settings, and online for Veterans.</p>\r\n','filtered_html'),('node','resources',0,135,135,'und',0,'<p>Veterans on Campus: Peer Program is an online, interactive training simulation that teaches student veterans and student leaders how to support fellow student veterans as they face challenges in transitioning to college life, including isolation, cultural disparities, academic difficulties, time management, and mental-health issues such as TBI, depression, and PTSD.</p>\r\n','filtered_html'),('node','resources',0,136,136,'und',0,'<p>FOCUS provides resiliency training to military children and families. It teaches practical skills to help families overcome common challenges related to a parent\'s military service, to communicate and solve problems effectively, and to successfully set goals together and create a shared family story. Intervation online education tools can be found at http://www.focusproject.org/focus-world-intro</p>\r\n','filtered_html'),('node','resources',0,137,137,'und',0,'<p>IAVA strives to build an empowered generation of veterans who provide sustainable leadership for our country and their local communities by supporting veterans through programs in four key impact areas: health, education, employment, and building a lasting community for vets and their families.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,138,138,'und',0,'<p>Storm the Hill is IAVA’s signature leadership development program. Over the years, it has grown from a handful of Veterans walking the hall’s of Congress into an annual event placing Iraq and Afghanistan veterans in more than 100 meetings with our nation’s leaders. Through participation in Storm the Hill, Veterans not only advocate on behalf of their peers, but also earn a sense of fulfillment and community by giving back.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,139,139,'und',0,'<p>VetTogethers are IAVA’s signature events for Veterans and supporters to share in a common goal of (re)building camaraderie. Driven by a growing member base, VetTogethers boost local leaders who foster a strong peer network and keep conversations going with every event. VetTogethers ensure that connections are forged whether you’re a veteran transitioning home, a retiree looking for a way to give back or a student hoping to engage with your peers.</p>\r\n','filtered_html'),('node','resources',0,140,140,'und',0,'<p>Kognito Family of Heroes is a 1-hour, online role-playing training simulation for military families of service members recently returned from deployment (within the past 4 years) designed to: (1) increase awareness of signs of postdeployment stress, including posttraumatic stress disorder (PTSD), traumatic brain injury (TBI), depression, and suicidal ideation, and (2) motivate family members to access mental health services when they show signs of postdeployment stress. Costs range from $5 per user to $100 per user, with an average cost of approximately $25 per user or starting at $2,500 per institution. Communities should contact Kognito for a price quote to meet their specific need: info@kognito.com or 212-675-9234.</p>\r\n','filtered_html'),('node','resources',0,141,141,'und',0,'<p>The Make the Connection campaign helps Veterans and their families connect with services that improve their lives. The campaign encourages Veterans and their families to “make the connection”—with other people, with resources, with symptoms of mental health issues, and with treatment and support—to get their lives on a better track.</p>\r\n','filtered_html'),('node','resources',0,142,142,'und',0,'<p>MilitaryFamily.com provides support and guidance to active-duty and retired military members and their families. Enjoy articles, news &amp; opinion, giveaways, free downloads, apps and more.</p>\r\n','filtered_html'),('node','resources',0,143,143,'und',0,'<p>Mission Reconnect is an evidence-based program of mind and body therapies for use by Veterans and their partners to support physical, mental and relationship health including guided instruction in strategies for connecting with yourself, connecting with quiet, and connecting with your partner.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,144,144,'und',0,'<p>Outward Bound offers free wilderness retreats to Veterans to help build a supportive community with other war veterans through facilitating discussions on readjustment and transition challenges. The programs re-energize and reinvigorate spirits with adventures and challenges in the beautiful outdoors.</p>\r\n','filtered_html'),('node','resources',0,145,145,'und',0,'<p>POS REP is a mobile, proximity-based social network made expressly for the military veteran community. Short for Position Report, POS REP connects veterans who served together and &nbsp;allows veterans to discover local peers and resources in the palm of their hand.</p>\r\n','filtered_html'),('node','resources',0,146,146,'und',0,'<p>The Ready Airman Mobile App gives Airmen and their families quick access to important resiliency resources—including a geo-location based local and national resource directory, crisis prevention information.</p>\r\n','filtered_html'),('node','resources',0,147,147,'und',0,'<p>Real Warriors helps identify when Veterans need to reach out, seek treatment or develop new coping skills to manage stress by providing tips to help recognize when you need help, treatment options and community and military health care resources. Real Warriors Includes a number of links to access various skills and coping mechanisms including: reducing job interview stress, managing chronic pain, building resilience to cope with difficult situations, and how Veterans can aid resilience by writing etc.</p>\r\n','filtered_html'),('node','resources',0,148,148,'und',0,'<p>Real Warriors, Real Battles, Real Strength: Building Resilience to Cope with Difficult Situations provides information and resources to build resilience and help Veterans manage stress. &nbsp;</p>\r\n','filtered_html'),('node','resources',0,149,149,'und',0,'<p>Real Warriors, Real Battles, Real Strength: How Veterans can Build Resilience by Writing provides information on how to start a journal and the benefits of doing so and also includes \"real warriors\" message boards to increase communication and support amongst veterans</p>\r\n','filtered_html'),('node','resources',0,150,150,'und',0,'<p>The Soldiers Project provides a safety net of psychological care for military service members and their loved ones, as well as educating the general public on how the psychological consequences of war affect not only those who serve, but also their loved ones at home and in our communities. We provide free, confidential professional psychological counseling services to those who have served in our nations military after September 11, 2001.</p>\r\n','filtered_html'),('node','resources',0,151,151,'und',0,'<p>Vets Prevail is a veteran-created online mental health program created to combat the challenges faced by returning veterans suffering from depression and PTSD. The program combines the principles of Cognitive Behavioral Therapy (CBT) with interactive e-learning techniques to educate and provide veterans with tools to overcome mental health challenges faced upon returning home from deployment. Vets Prevail utilizes a variety of techniques including: interactive videos, live chats with trained Peer Coaches, and a peer network of veterans to motivate and help veterans readjust to life after returning home.</p>\r\n','filtered_html'),('node','resources',0,152,152,'und',0,'<p>Vets4Warriors provides 24/7 peer support for Veterans regarding legal issues, housing, medical, psychological and other need. The website also provides a list of resources to promote psychological health.</p>\r\n','filtered_html'),('node','resources',0,153,153,'und',0,'<p>The Virtual Hope Box (VHB) is a smartphone application designed for use by patients and their behavioral health providers as an accessory to treatment. The VHB contains simple tools to help patients with coping, relaxation, distraction, and positive thinking.</p>\r\n','filtered_html'),('node','resources',0,154,154,'und',0,'<p>The Wellness Recovery Action Plan (WRAP) for Veterans and People in the Military Booklet was adapted from the well-known and widely used book Wellness Recovery Action Plan. This version of the plan was developed with input and guidance from active military and veteran populations. While anyone can design and use their own WRAP, developing the plan with a supporter, in a group, or even as a family increases options and understanding. Copies are available for $6.00 per booklet.</p>\r\n','filtered_html'),('node','resources',0,155,155,'und',0,'<p>The Wingman Toolkit is a total force initiative designed to empower Airmen and their families to live healthier lifestyles both on and off duty. The toolkit is comprised of a vast collection of resiliency-related articles and resources, each focused on one or more of the Comprehensive Airman Fitness domains.</p>\r\n','filtered_html'),('node','resources',0,156,156,'und',0,'<p>Project Rebirth creates programs that facilitate healing, foster hope, and build resilience by focusing on those who work as first responders, military and veterans, educators and all who serve in a leadership role within their community using collaboration and cooperation to develop simple and effective models for coping with grief, loss and trauma and for building resilience. Project Rebirth includes educational tools and adaptable program models allowing participants to share them when they return to their own communities.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,157,157,'und',0,'<p>311Vet is a 24/7 support for Veterans providing information regarding VA benefits. Users can text 311VET with questions or download the 311Vet smartphone application to have their questions answered.&nbsp;</p>\r\n','filtered_html'),('node','resources',0,158,158,'und',0,'<p>The American Legion Claims Coach Application provides step-by-step guidance to help you and your service officer through the process of filing for VA benefits.</p>\r\n','filtered_html'),('node','resources',0,159,159,'und',0,'<p>Give an Hour is a national networks of mental health professionals who volunteer their time to meet the needs of the troops and families affected by the post-9/11 conflicts in Iraq and Afghanistan through the provision of in-person, telephone support and video counseling.</p>\r\n','filtered_html');
