INSERT INTO `search_dataset` VALUES (57,'node',' levels of community intervention togetherwithveterans  employs interventions at five levels the five intervention levels work together to simultaneously address both individuallevel risk factors eg helpseeking behavior identification and management of mental illness and communitylevel barriers eg outreach to veterans in need of support availability of services and resources and public awareness of veteran suicide risk that may increase risk for suicide among veterans living in rural areas because community participation and ownership is integral to ensuring that these interventions are both successfully implemented and sustained togetherwithveterans emphasizes shared decisionmaking and community buyin at all stages to determine what will work best in individual rural communities please use the below links to view descriptions and resources for each of the five intervention levels  levels community intervention  ',0),(58,'node',' about togetherwithveterans the goal of together with veterans is to build and sustain local capacity to implement multiple coordinated suicide prevention strategies together with veterans is a communityengaged process for identifying selecting and implementing a variety of evidence based and promising practices for the reduction of suicide and promotion of wellness among veterans living in rural communities every community is different rather than a onesizefits all approach together with veterans provides a process that embraces the differences as opportunities to maximize the impact of suicide prevention efforts by identifying local needs and contexts suicide prevention strategies are tailored to individual communities together with veterans is a partnership between local community members veterans health administration and suicide prevention experts the partnership brings together local knowledge and expertise with the resources training and technical assistance needed to enhance local capacity  ',0),(59,'node',' implement togetherwithveterans the together with veterans implementation strategy is modeled after best practices in community based participatory research cbpr   1  cbpr is a grassroots research and action framework emphasizing shared decisionmaking and buyin at all stages of engagement implementation and evaluation cbpr is widely recognized as an effective approach to reducing health disparities  2  participatory approaches to community health intervention maximize the effective implementation of evidence based practices by ensuring that the work is fully grounded in the local community s knowledge and needs no one knows their community better than themselves perhaps most important participation means humility listening and learning to respect all participants as providing knowledge to improve and enhance action together with veterans steps overview build partnerships involving traditional and nontraditional partners  develop partnerships and identify a coalition or advisory board to oversee planning implementation and evaluation in developing the coalition it is important to find champions from within the community to not only help lead the process but also help identify the right stakeholders for the coalition traditional partners may include community leadership healthcare social services first responders and external experts nontraditional partners are equally important and may include natural leaders and champions of veterans issues veterans and their family members social clubs businesses and other veteran organizations conduct a community needs and readiness assessment  there are numerous tools for conducting needs and readiness assessments the assessments will be critical to guide community team members in the process of creating sustainable communitybased changes that address a variety of suiciderelated risk factors assessments will cover characterizing the need understanding the veteran population and community inventorying current community resources and past efforts in suicide prevention and health promotion understanding the history of veteran relations and health services conducting swot and readiness assessments and identifying critical partners beyond the coalition identify intervention and practices to implement  select evidence based and promising interventions and strategies from the levels of community intervention or other activities not listed that are consistent with the community s needs and opportunities decisions should be based on needs priorities and readiness of the community to carry out interventions develop an action and evaluation plan  develop a plan for implementing the strategies the proposed action plan will also be accompanied by a plan for conducting the necessary data collection for a thorough and valid evaluation evaluation not only serves to identify the impacts of the program but also is important to implementing a continuous quality improvement strategy whereby ongoing evaluation findings can lead to program improvements to maximize outcomes implement and evaluate  carry out the action and evaluation plan employing iterative feedback loops to facilitate process improvement throughout implementation and evaluation use the information and experience from implementation and evaluation to develop a sustainability plan  1 numerous publications and books detail the methods advantages and challenges of cbpr including faridi z grunbaum ja gray bs franks a simoes e communitybased participatory research necessary next steps prev chronic dis serial online 2007 jul wallerstein n duran b 2010   communitybased participatory research contributions to intervention research the intersection of science and practice to improve health equity  american journal of public health   100  and newman s d andrews j o magwood g s jenkins c cox m j williamson d c 2011 peer reviewed community advisory boards in communitybased participatory research a synthesis of best processes preventing chronic disease   8  3   2 wallerstein n b duran b 2006 using communitybased participatory research to address health disparities health promotion practice 7  3 312323 and trickett e j beehler s deutsch c green l w hawe p mcleroy k schulz a j 2011 advancing the science of communitylevel interventions american journal of public health 101  8 1410 ',0),(60,'node',' ask prevent suicide n a ask prevent suicide is a free smartphone app providing crisis intervention resources and information regarding suicide prevention used in over 80 countries this app is based on the ask best practices suicide prevention training program level 1 crisis intervention civilian nonva unspecified ask prevent suicide national smart phone app ',0),(61,'node',' crisis text line text 741741 the crisis text line provides free 247 emotional support for those in crisis designed for adolescent and young adult populations level 1 crisis intervention civilian nonva unspecified crisis text line national crisis text line ',0),(62,'node',' dod 247 help for psychological health and traumatic brain injury issues 8669661020 the dod help for psychological health and traumatic brain injury provides 247 phone live chat and email for service members family friends and clinicians for crisis services and information regarding traumatic brain injury dcoe outreach center professional health consultants have expertise in psychological health and traumtic brain injury in the context on military culture level 1 crisis intervention military nonva unspecified dod 247 help for psychological health and traumatic brain injury issues national crisis line live online chat ',0),(63,'node',' dstress line 8774767734 dstress line provided by united states marine corps program provides 247 peer support and connections resources providing including a crisis line and live chat level 1 crisis intervention military nonva unspecified dstress line national crisis line live online chat ',0),(64,'node',' friendship line institute on aging  8009710016 the friendship line is a nationally accredited 247 crisis line offering a human connection for people 60 years of age and older younger disabled and caregivers of any age trained staff and volunteers make and receive calls to and from individuals who are either in crisis or just in need of a friend for many individuals the voice at the other end of the friendship line is the connection they never expected to have at a time when they need it most level 1 crisis intervention civilian nonva unspecified friendship line institute on aging  national crisis line ',0),(65,'node',' imaliveorg instant message service imalive is a virtual crisis center with 100 of volunteers trained in crisis intervention in the first year since the launch imalive has helped thousands of people in crisis level 1 crisis intervention civilian nonva unspecified imaliveorg national live online chat ',0),(66,'node',' my3 n a my3 is a free smartphone app assisting individuals experiencing suicidal thoughts to be prepared to help themselves and reach out to others when having thoughts of suicide level 1 crisis intervention civilian nonva unspecified my3 national smart phone app ',0),(67,'node',' national suicide prevention lifeline 8002738255 the national suicide prevention lifeline is a 247 free and confidential emotional support to people in suicidal crisis or emotional distress since its inception the lifeline has engaged in a variety of initiatives to improve crisis services and advance suicide prevention level 1 crisis intervention civilian nonva unspecified national suicide prevention lifeline national crisis line ',0),(68,'node',' operation reach out n a operation reach out is a free a smartphone app aimed at preventing suicide among military personnel and veterans level 1 crisis intervention military nonva unspecified operation reach out national smart phone app ',0),(69,'node',' suicide lifeguard phone app n a the suicide lifeguard mobile app intended for anyone concerned that someone they know may be thinking of suicide it provides information on how to recognize warning signs of suicide how to ask about suicidal thoughts and or intentions how to respond and where to refer someone level 1 crisis intervention civilian nonva unspecified suicide lifeguard phone app national smart phone app ',0),(70,'node',' va crisis resource locator n a the va crisis resource locator is a website which allows veterans and their support networks to search for all va and communitybased services near their location including suicide prevention coordinators crisis centers va medical centers outpatient clincs veterans benefits administration offices and vet centers the website also includes links to the veteran s crisis line crisis text line and live online chat level 1 crisis intervention military va unspecified va crisis resource locator national web site ',0),(71,'node',' hopeline 1800442hope 1800suicida hopeline is a 247crisis support line that connects callers to certified crisis center nearest to their calling location  level 1 crisis intervention civilian nonva unspecified hopeline national crisis line ',0),(72,'node',' va dod va overcoming suicidal thoughts and feelings n a the va dod va overcoming suicidal thoughts and feelings is a brief 2page brochure that outlines coping strategies to overcome suicidal thoughts and feelings level 1 crisis intervention military va unspecified va dod va overcoming suicidal thoughts and feelings national brochure print  brochure pdf download  ',0),(73,'node',' vet2vet 877vet2vet 8778382838 vet2vet is a 247 crisis line which connects veterans in crisis to trained peer counselors peer counselors provide hope crisis support and assist veterans navigate the va system to access appropriate mental health resources level 5 crisis intervention military nonva unspecified vet2vet national crisis line ',0),(74,'node',' veterans crisis line part of national suicide prevention lifeline  8002738255 press 1 the veterans crisis line is a 247 crisis line that connects veterans in crisis and their families and friends with qualified caring department of veterans affairs responders through a confidential tollfree hotline online chat or text  level 1 crisis intervention military va unspecified veterans crisis line part of national suicide prevention lifeline  national crisis line crisis text line ',0),(75,'node',' vets4warriors 8558388255 vets4warriors provides 247 peer support for veterans regarding legal issues housing medical psychological and other need the website also provides a list of resources to promote psychological health level 1 crisis intervention military nonva unspecified vets4warriors national crisis line live online chat ',0),(76,'node',' colorado crisis services 1844493talk 8255 or go to the nearest walkin center colorado crisis services provides 247 crisis support for any mental health substance use or emotional crisis  level 1 crisis intervention civilian nonva unspecified colorado crisis services local resources colorado crisis line ',0),(77,'node',' southeast health group 24hour mh emergency line 8005115446 southeast health group shg is a private nonprofit corporation providing mental health substance use disorder primary care and wellness services to six rural and frontier colorado counties baca bent crowley kiowa otero and prowers including a 247 crisis intervention including a mobile crisis team and assessment services a discounted sliding fee schedule is available and no one is refused service due to the inability to pay  level 1 crisis intervention civilian nonva rural southeast health group local resources colorado agency ',0),(78,'node',' local va suicide prevention coordinator n a the pueblo va suicide prevention coordinator is responsble for promoting suicide prevention in the pueblo and surrounding area level 1 crisis intervention military va unspecified local va suicide prevention coordinator local resources colorado va suicide prevention coordinator ',0),(79,'node',' crossroads turning points inc hotlines pueblo 7195451181 7195466666 trinidad 7198464481 alamosa 7195895176 crossroads turning points provides comprehensive family services to fifteen counties in the southern colorado region the alamosa location provides outpatient services substance abuse services and detox level 1 crisis intervention civilian nonva rural crossroads turning points inc local resources alamosa co agency ',0),(80,'node',' san luis valley behavioral health group hotlines 7195893671 7195893671 8745 county rd 9 south alamosa co 81101 united states the san luis behavioral health group slvbhg is a comumunity behavioral health agency providing a comprehensive array of services including prevention crisis intervention outpatient mental health services addiction treatment services and judicial and offender services level 1 crisis intervention civilian nonva rural san luis valley behavioral health group local resources alamosa co agency ',0),(81,'node','  is your patient suicidal emergency department poster and clinical guide the is your patient suicidal ed poster provides emergency department practitioners with information on recognizing and responding to acude suicidal risk the poster is available as a free downloadable pdf for 10 for printed posters level 2 enhanced education and training in primary care civilian nonva unspecified  is your patient suicidal emergency department poster and clinical guide national poster ',0),(82,'node',' after an attempt a guide for medical providers in the emergency department taking care of suicide attempt survivors the guide for medical providers in the emergency department taking care of suicide attempt survivors is a 14 page brochure from us substance abuse and mental health services administration provides information regarding emergency department care of suicide attempters it is intended to increase awareness among medical professionals for serving patients who have had a suicide attempt level 2 enhanced education 