e information about currently available VHA and community resources for crisis and support services.</p>\n\n<h2>How:</h2>\n\n<p>Distribute VHA posters, fliers, and other resources advertising available VHA suicide and crisis services such as the National Veterans Crisis Line and the VHA Suicide Prevention Coordinators as well as other community based services across multiple community settings; Develop materials to educate about how to use crisis and support services and dispel any myths that may hinder use. Anticipated Impact: Increased awareness and utilization of available VHA and community crisis and support services.</p>\n\";s:6:\"format\";s:9:\"full_html\";s:8:\"tokenize\";i:0;}}s:8:\"defaults\";a:3:{s:6:\"header\";b:0;s:7:\"filters\";b:0;s:13:\"filter_groups\";b:0;}s:7:\"filters\";a:2:{s:6:\"status\";a:6:{s:5:\"value\";i:1;s:5:\"table\";s:4:\"node\";s:5:\"field\";s:6:\"status\";s:2:\"id\";s:6:\"status\";s:6:\"expose\";a:1:{s:8:\"operator\";b:0;}s:5:\"group\";i:1;}s:4:\"type\";a:5:{s:2:\"id\";s:4:\"type\";s:5:\"table\";s:4:\"node\";s:5:\"field\";s:4:\"type\";s:5:\"value\";a:1:{s:9:\"resources\";s:9:\"resources\";}s:5:\"group\";i:1;}}s:13:\"filter_groups\";a:2:{s:8:\"operator\";s:3:\"AND\";s:6:\"groups\";a:1:{i:1;s:3:\"AND\";}}}'),(4,'page_1','Community Gatekeepers','page',5,'a:16:{s:5:\"query\";a:2:{s:4:\"type\";s:11:\"views_query\";s:7:\"options\";a:0:{}}s:4:\"path\";s:27:\"train-community-gatekeepers\";s:6:\"header\";a:1:{s:4:\"area\";a:11:{s:2:\"id\";s:4:\"area\";s:5:\"table\";s:5:\"views\";s:5:\"field\";s:4:\"area\";s:12:\"relationship\";s:4:\"none\";s:10:\"group_type\";s:5:\"group\";s:7:\"ui_name\";s:0:\"\";s:5:\"label\";s:0:\"\";s:5:\"empty\";i:1;s:7:\"content\";s:666:\"<h2>Who:</h2>\n\n<p>Rural community members including both lay citizens and professionals (e.g., clergy, first responders, teachers and school personnel, including community colleges).</p>\n\n<h2>What:</h2>\n\n<p>Enhance community competence to identify and refer Veterans at risk for suicide to appropriate services.</p>\n\n<h2>How:</h2>\n\n<p>Provide evidence-based community gatekeeper training, such as ASIST, Yellow Ribbon, and QPR, tailored for Veterans to individuals who are likely to interact with Veterans at-risk for suicide.</p>\n\n<h2>Anticipated impact:</h2>\n\n<p>Increase in community’s capacity to identify and provide help to Veterans at-risk for suicide.</p>\n\";s:6:\"format\";s:9:\"full_html\";s:8:\"tokenize\";i:0;}}s:8:\"defaults\";a:12:{s:6:\"header\";b:0;s:6:\"fields\";b:0;s:8:\"use_more\";b:0;s:15:\"use_more_always\";b:0;s:13:\"use_more_text\";b:0;s:12:\"style_plugin\";b:0;s:13:\"style_options\";b:0;s:10:\"row_plugin\";b:0;s:11:\"row_options\";b:0;s:5:\"title\";b:0;s:7:\"filters\";b:0;s:13:\"filter_groups\";b:0;}s:6:\"fields\";a:7:{s:5:\"title\";a:22:{s:2:\"id\";s:5:\"title\";s:5:\"table\";s:4:\"node\";s:5:\"field\";s:5:\"title\";s:12:\"relationship\";s:4:\"none\";s:10:\"group_type\";s:5:\"group\";s:7:\"ui_name\";s:0:\"\";s:5:\"label\";s:0:\"\";s:7:\"exclude\";i:0;s:5:\"alter\";a:26:{s:10:\"alter_text\";i:0;s:4:\"text\";s:0:\"\";s:9:\"make_link\";i:0;s:4:\"path\";s:0:\"\";s:8:\"absolute\";i:0;s:8:\"external\";i:0;s:14:\"replace_spaces\";i:0;s:9:\"path_case\";s:4:\"none\";s:15:\"trim_whitespace\";i:0;s:3:\"alt\";s:0:\"\";s:3:\"rel\";s:0:\"\";s:10:\"link_class\";s:0:\"\";s:6:\"prefix\";s:0:\"\";s:6:\"suffix\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"nl2br\";i:0;s:10:\"max_length\";s:0:\"\";s:13:\"word_boundary\";i:0;s:8:\"ellipsis\";i:0;s:9:\"more_link\";i:0;s:14:\"more_link_text\";s:0:\"\";s:14:\"more_link_path\";s:0:\"\";s:10:\"strip_tags\";i:0;s:4:\"trim\";i:0;s:13:\"preserve_tags\";s:0:\"\";s:4:\"html\";i:0;}s:12:\"element_type\";s:2:\"h3\";s:13:\"element_class\";s:0:\"\";s:18:\"element_label_type\";s:0:\"\";s:19:\"element_label_class\";s:0:\"\";s:19:\"element_label_colon\";b:0;s:20:\"element_wrapper_type\";s:0:\"\";s:21:\"element_wrapper_class\";s:0:\"\";s:23:\"element_default_classes\";i:1;s:5:\"empty\";s:0:\"\";s:10:\"hide_empty\"